import React from 'react';
import { useState } from 'react';
import axios from 'axios';


const Contacts = () => {
  const [name, setName] = useState('');
  const [tel, setTel] = useState();
  const [email, setEmail] = useState('');

  return (
    <div className="contacts">
      <form className="contacts__form">
        <label className="contacts__form__label">Name:
        <input className="contacts__form__input" type="text" name="name" onChange={(e) => setName(e.target.value)}/></label>

        <label className="contacts__form__label">Number:
        <input className="contacts__form__input" type="tel" name="tel" /></label>

        <label className="contacts__form__label">Email:
        <input className="contacts__form__input" type="email" name="email" /></label>

        <input type="submit" className="contacts__form__submit"></input>
      </form>
    </div>

  )
}

export default Contacts
